script: |
  super -f text -I q9120.sql | sort > q9120.out

inputs:
  - name: q9120.sql
    data: |
      SELECT cor0.col2 AS col1 FROM tab0 AS cor0 WHERE NOT ( col0 * col2 ) > ( + cor0.col2 + cor0.col0 * + col2 * col0 + + cor0.col2 );
  - name: tab0

outputs:
  - name: q9120.out
    data: |
      1
      33
      82
